import React, { Component } from 'react';
import './App.css';
import Cards from './Cards';

class App extends Component {
  constructor(){
    super()
    this.state = {
      firstname: "Andres",
      lastname: "Ochoa"
    }
  }

  componentDidMount(){
    return(
      fetch("https://swapi.co/api/people/1")
        .then(result => result.json())
        .then(person => console.log(person.name))
    )
  } 

  render(){
    return(
      <div>
        <Cards />               
      </div>
    )
  } 
}

export default App;
